import React from 'react'
import BinaryNum from './BinaryNum';

export default function GiveRow() {
        const components = [];
        const count = 20;
        const cyanShades = [
            '#000000',  // Black
            '#003333',  // Dark Cyan
            '#004c4c',
            '#006666',
            '#007f7f',
            '#009999',
            '#00b2b2',
            '#00cccc',
            '#00e6e6',
            '#00ffff',  // Cyan
            '#1affff',
            '#33ffff',
            '#4dffff',
            '#66ffff',
            '#80ffff',
            '#99ffff',
            '#b2ffff',
            '#ccffff',
            '#e6ffff',
          ];
                    
        const clr = 'cyan'
    
        for (let i = 0; i < count; i++) {
            components.push(<BinaryNum key={i} />);
        }
    
        return <div style={{backgroundColor:clr}}>{components}</div>;
    
}
